import React,{ useEffect, useState }  from 'react';
import Logo from './logo_template.js';
import { Box,Button,colors,TextField } from '@mui/material';

export default function DeletePageBtn(props){
    const [open, setOpen] = React.useState(false);
    const handleClickOpen = () => {
        setOpen(true);
    };

    const handleClose = () => {
        setOpen(false);
    };
    

    return(<Box paddingLeft={"50%"}>
        <Box paddingLeft={"40%"}>
                    <Button variant="contained" color="error" onClick={handleClickOpen}>
                        Удалить Страницу!
                    </Button >
                        <Dialog
                            open={open}
                            onClose={handleClose}
                            aria-labelledby="alert-dialog-title"
                            aria-describedby="alert-dialog-description"
                            >
                            <DialogTitle id="alert-dialog-title">
                            {"Вы точно хотите удалить курс ?"}
                            </DialogTitle>
                            <DialogContent>
                            <DialogContentText id="alert-dialog-description">
                                
                            </DialogContentText>
                            </DialogContent>
                            <DialogActions>
                            <Button color="success" onClick={handleClose}>Отказаться</Button>
                            <Button color="error" onClick={deleteCourseOnclick} autoFocus>
                                Подтвердить
                            </Button>
                            </DialogActions>
                        </Dialog>

                </Box>
        </Box>
    );

}
